import './Form.css'
import Address from './Address/Address';
import Billing from './Billing/Billing'

class Form extends React.Component{

    render(){
        return <div className="form">
                    <div className="form__billContainer">
                        <Address />
                    </div>
                    <div className="form__orderContainer">
                        
                    </div>
               </div>     
    }
}

export default Form;
